// frontend/src/pages/participants/Care/CareSetup.tsx - Updated with better styling
import { useEffect, useState } from "react";
import { useParams, Link } from "react-router-dom";
import { Heart, Shield, Brain, FileText, CheckCircle, Clock, ArrowRight, User } from "lucide-react";
import { supabase } from "../../../lib/supabase";

type Participant = {
  id: string;
  first_name: string;
  last_name: string;
  status: string;
  referral: string | null;
};

export default function CareSetup() {
  const { participantId } = useParams<{ participantId: string }>();
  const [p, setP] = useState<Participant | null>(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    (async () => {
      if (!participantId) return;

      try {
        const { data, error } = await supabase
          .from("participants")
          .select("*")
          .eq("id", participantId)
          .single();

        if (!error && data) {
          setP(data as Participant);
        } else {
          // Mock data for development when Supabase is not available
          setP({
            id: participantId,
            first_name: participantId.includes('1') ? 'Jordan' : participantId.includes('2') ? 'Amrita' : 'Linh',
            last_name: participantId.includes('1') ? 'Smith' : participantId.includes('2') ? 'Kumar' : 'Nguyen',
            status: 'validated',
            referral: participantId.includes('1') ? 'Occupational Therapy' : participantId.includes('2') ? 'Physiotherapy' : 'Speech Pathology'
          });
        }
      } catch (error) {
        console.error('Error fetching participant:', error);
        // Mock data fallback
        setP({
          id: participantId,
          first_name: 'Sample',
          last_name: 'Participant',
          status: 'validated',
          referral: 'General Support'
        });
      } finally {
        setLoading(false);
      }
    })();
  }, [participantId]);

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600 mx-auto"></div>
          <p className="mt-4 text-gray-600">Loading participant data...</p>
        </div>
      </div>
    );
  }

  if (!p) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="text-center">
          <div className="text-red-600 text-6xl mb-4">⚠️</div>
          <h2 className="text-xl font-semibold text-gray-900 mb-2">Participant Not Found</h2>
          <p className="text-gray-600">The requested participant could not be found.</p>
          <Link 
            to="/provider" 
            className="mt-4 inline-flex items-center px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700"
          >
            Return to Dashboard
          </Link>
        </div>
      </div>
    );
  }

  const steps = [
    {
      id: 'care-plan',
      title: 'Care Plan',
      description: 'Develop comprehensive care strategies and goals',
      icon: Heart,
      color: 'pink',
      to: `/care/plan/${p.id}/edit`,
      status: 'pending' // This would come from your data
    },
    {
      id: 'risk-assessment',
      title: 'Risk Assessment',
      description: 'Identify and mitigate potential risks',
      icon: Shield,
      color: 'red',
      to: `/care/risk/${p.id}/edit`,
      status: 'pending'
    },
    {
      id: 'ai-assist',
      title: 'AI Assist',
      description: 'Get AI-powered recommendations and insights',
      icon: Brain,
      color: 'purple',
      to: `/care/ai/${p.id}`,
      status: 'available'
    }
  ];

  const getColorClasses = (color: string, variant: 'bg' | 'text' | 'border' | 'hover') => {
    const colorMap = {
      pink: {
        bg: 'bg-pink-50',
        text: 'text-pink-600',
        border: 'border-pink-200',
        hover: 'hover:bg-pink-100'
      },
      red: {
        bg: 'bg-red-50',
        text: 'text-red-600',
        border: 'border-red-200',
        hover: 'hover:bg-red-100'
      },
      purple: {
        bg: 'bg-purple-50',
        text: 'text-purple-600',
        border: 'border-purple-200',
        hover: 'hover:bg-purple-100'
      }
    };
    return colorMap[color as keyof typeof colorMap]?.[variant] || '';
  };

  const getStatusIcon = (status: string) => {
    switch (status) {
      case 'completed':
        return <CheckCircle className="h-5 w-5 text-green-600" />;
      case 'pending':
        return <Clock className="h-5 w-5 text-yellow-600" />;
      default:
        return <ArrowRight className="h-5 w-5 text-gray-400" />;
    }
  };

  const getStatusBadge = (status: string) => {
    switch (status) {
      case 'completed':
        return (
          <span className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-green-100 text-green-800">
            Complete
          </span>
        );
      case 'pending':
        return (
          <span className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-yellow-100 text-yellow-800">
            Pending
          </span>
        );
      default:
        return (
          <span className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-blue-100 text-blue-800">
            Available
          </span>
        );
    }
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <div className="bg-white shadow">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="py-6">
            <div className="flex items-center justify-between">
              <div className="flex items-center space-x-4">
                <div className="flex-shrink-0">
                  <div className="h-12 w-12 bg-blue-100 rounded-full flex items-center justify-center">
                    <User className="h-6 w-6 text-blue-600" />
                  </div>
                </div>
                <div>
                  <h1 className="text-2xl font-bold text-gray-900">Care Setup</h1>
                  <p className="text-sm text-gray-600">
                    Configure care plans and assessments for this participant
                  </p>
                </div>
              </div>
              <Link 
                to="/provider"
                className="inline-flex items-center px-4 py-2 border border-gray-300 rounded-lg text-sm font-medium text-gray-700 bg-white hover:bg-gray-50"
              >
                Back to Dashboard
              </Link>
            </div>
          </div>
        </div>
      </div>

      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        {/* Participant Information */}
        <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-6 mb-8">
          <h2 className="text-lg font-semibold text-gray-900 mb-4">Participant Information</h2>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            <div>
              <span className="text-sm font-medium text-gray-500">Name</span>
              <p className="text-lg text-gray-900">{p.first_name} {p.last_name}</p>
            </div>
            <div>
              <span className="text-sm font-medium text-gray-500">Status</span>
              <p className="text-lg">
                <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-sm font-medium ${
                  p.status === 'validated' ? 'bg-green-100 text-green-800' : 'bg-yellow-100 text-yellow-800'
                }`}>
                  {p.status}
                </span>
              </p>
            </div>
            <div>
              <span className="text-sm font-medium text-gray-500">Service Type</span>
              <p className="text-lg text-gray-900">{p.referral || 'General Support'}</p>
            </div>
          </div>
        </div>

        {/* Care Setup Steps */}
        <div className="space-y-6">
          <div>
            <h2 className="text-xl font-semibold text-gray-900 mb-2">Care Setup Steps</h2>
            <p className="text-gray-600 mb-6">
              Complete these steps to set up comprehensive care for this participant.
            </p>
          </div>

          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {steps.map((step) => {
              const Icon = step.icon;
              return (
                <Link
                  key={step.id}
                  to={step.to}
                  className={`relative group block p-6 bg-white rounded-lg border-2 ${getColorClasses(step.color, 'border')} ${getColorClasses(step.color, 'hover')} transition-all duration-200 hover:shadow-md`}
                >
                  <div className="flex items-start justify-between mb-4">
                    <div className={`flex-shrink-0 w-12 h-12 ${getColorClasses(step.color, 'bg')} rounded-lg flex items-center justify-center`}>
                      <Icon className={`h-6 w-6 ${getColorClasses(step.color, 'text')}`} />
                    </div>
                    <div className="flex items-center space-x-2">
                      {getStatusBadge(step.status)}
                      {getStatusIcon(step.status)}
                    </div>
                  </div>

                  <h3 className="text-lg font-semibold text-gray-900 mb-2 group-hover:text-gray-700">
                    {step.title}
                  </h3>
                  <p className="text-sm text-gray-600 mb-4">
                    {step.description}
                  </p>

                  <div className="flex items-center text-sm font-medium text-blue-600 group-hover:text-blue-500">
                    {step.status === 'completed' ? 'Review' : step.status === 'pending' ? 'Continue' : 'Start'}
                    <ArrowRight className="ml-1 h-4 w-4 transition-transform group-hover:translate-x-1" />
                  </div>
                </Link>
              );
            })}
          </div>
        </div>

        {/* Progress Overview */}
        <div className="mt-8 bg-white rounded-lg shadow-sm border border-gray-200 p-6">
          <h3 className="text-lg font-semibold text-gray-900 mb-4">Setup Progress</h3>
          <div className="space-y-4">
            <div className="flex items-center justify-between">
              <span className="text-sm font-medium text-gray-600">Overall Progress</span>
              <span className="text-sm text-gray-500">1 of 3 completed</span>
            </div>
            <div className="w-full bg-gray-200 rounded-full h-2">
              <div className="bg-blue-600 h-2 rounded-full" style={{ width: '33%' }}></div>
            </div>
            <div className="flex justify-between text-xs text-gray-500">
              <span>Participant validated</span>
              <span>Ready for service delivery</span>
            </div>
          </div>
        </div>

        {/* Quick Actions */}
        <div className="mt-8 bg-gradient-to-r from-blue-50 to-indigo-50 rounded-lg p-6">
          <h3 className="text-lg font-semibold text-gray-900 mb-4">Quick Actions</h3>
          <div className="flex flex-wrap gap-3">
            <Link
              to={`/care/signoff/${p.id}`}
              className="inline-flex items-center px-4 py-2 bg-green-600 text-white rounded-lg hover:bg-green-700 transition-colors"
            >
              <FileText className="mr-2 h-4 w-4" />
              View Sign-off
            </Link>
            <button className="inline-flex items-center px-4 py-2 bg-gray-600 text-white rounded-lg hover:bg-gray-700 transition-colors">
              <User className="mr-2 h-4 w-4" />
              Export Summary
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
